import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-nav-bar',
  templateUrl: './nav-bar.component.html',
  styleUrls: ['./nav-bar.component.scss'],
})
export class NavBarComponent {
  constructor(private router: Router) {}
}
<div class="navbar">
  <div class="logo">
    <img src="../../../assets/images/netflix-logp.png" alt="netflix logo" [routerLink]="['/home']">
  </div>
  <div class="signin">
    <button mat-raised-button color="warn" id="sign-in-btn" [routerLink]="['/login']">Sign in</button>
  </div>
</div>
